import { useParams, Outlet } from "react-router-dom";
import { Fragment } from "react";

const QuoteDetail = (props) => {
  const params = useParams();

  return (
    <Fragment>
      <h1>QuoteDetail Page</h1>
      <p>{params.quoteId}</p>
      <Outlet />
    </Fragment>
  );
};

export default QuoteDetail;
